DROP TABLE IF EXISTS `REC_PROCEEDS`;
CREATE TABLE `REC_PROCEEDS` (
  `INTER_ID` int(11) NOT NULL AUTO_INCREMENT,
  `AMOUNT` double DEFAULT NULL,
  `BANK` varchar(255) DEFAULT NULL,
  `BANK_NUM` varchar(50) DEFAULT NULL,
  `BILL_NO` varchar(20) DEFAULT NULL,
  `CANCELLATION` int(11) DEFAULT '0',
  `cashSubject` varchar(255) DEFAULT NULL,
  `CHECK_DATE` datetime DEFAULT NULL,
  `CHECKER` int(11) DEFAULT NULL,
  `CHILDREN` int(11) DEFAULT '0',
  `CREATED` datetime DEFAULT NULL,
  `CREATER` int(11) DEFAULT NULL,
  `CURRENCY_ID` int(11) DEFAULT NULL,
