  `DEPARTMENT_ID` int(11) DEFAULT NULL,
  `EMPLOYEE_ID` int(11) DEFAULT NULL,
  `EXCHANGE_RATE` double DEFAULT NULL,
  `EXPLANATION` varchar(200) DEFAULT NULL,
  `LASTMOD` datetime DEFAULT NULL,
  `MODIFIER` int(11) DEFAULT NULL,
  `PROC_INST_ID` varchar(64) DEFAULT NULL,
  `REC_TYPE` varchar(20) DEFAULT NULL,
  `REMARK` varchar(2000) DEFAULT NULL,
  `RESULT` int(11) DEFAULT '0',
  `SETTLE_DATE` datetime DEFAULT NULL,
  `SETTLE_ID` int(11) DEFAULT NULL,
  `SETTLE_NUM` varchar(20) DEFAULT NULL,
  `SOURCE_BILL_NO` varchar(20) DEFAULT NULL,
  `SOURCE_TYPE` varchar(20) DEFAULT NULL,
  `STATUS` varchar(1) DEFAULT NULL,
  `SUBJECT` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`INTER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

